package org.example.entity;import org.example.utils.ProductType;import java.time.LocalDateTime;public class Product {    private int id;    private String name;    private Boolean isActive;    private Locator locator;    private LocalDateTime created;    private String createdBy;    private Integer qtyStock;    private int productParentId;    public Product(){}    public Product(int id, String name, Boolean isActive, Locator locator, LocalDateTime created, String createdBy,                   Integer qtyStock, int productParentId) {        this.id = id;        this.name = name;        this.isActive = isActive;        this.locator = locator;        this.created = created;        this.createdBy = createdBy;        this.qtyStock = qtyStock;        this.productParentId = productParentId;    }    public int getId() {        return id;    }    public void setId(int id) {        this.id = id;    }    public String getName() {        return name;    }    public void setName(String name) {        this.name = name;    }    public Boolean getActive() {        return isActive;    }    public void setActive(Boolean active) {        isActive = active;    }    public Locator getLocator() {        return locator;    }    public void setLocator(Locator locator) {        this.locator = locator;    }    public LocalDateTime getCreated() {        return created;    }    public void setCreated(LocalDateTime created) {        this.created = created;    }    public String getCreatedBy() {        return createdBy;    }    public void setCreatedBy(String createdBy) {        this.createdBy = createdBy;    }    public Integer getQtyStock() {        return qtyStock;    }    public void setQtyStock(Integer qtyStock) {        this.qtyStock = qtyStock;    }    public int getProductParentId() {        return productParentId;    }    public void setProductParentId(int productParentId) {        this.productParentId = productParentId;    }}